import React, { useState } from 'react';
import './Home.css';
import { Button, TextField, MenuItem, FormControl, InputLabel, Select } from '@material-ui/core';
import axios from 'axios';

const cities = ['Pune', 'Mumbai', 'Banglore'];
const states = ['Karnataka', 'UP', 'Punjab'];
const categories = ['Dancers', 'Singers']

export default function Home() {
    const [city, setCity] = useState('');
    // const [state, setState] = useState('');
    // const [category, setCategory] = useState('');

    const handleCity = () => {
        axios.get('http://localhost:8000/')
            .then(response => {
                setCity(JSON.stringify(response.data[1].city))
            })
            .catch(error => {
                console.log(error);
            })
    }
    console.log(city)

    return (
        <div className='home1'>
            <div className='paper'>
                <FormControl className='form-control'>
                    <TextField onChange={handleCity} id="standard-basic" label="Standard" />
                </FormControl>
            </div>
        </div>
    )
}
